import React from "react";
import RotaCOP30 from "./RotaCOP30";

function App() {
  return (
    <div>
      <header className="text-center py-4 bg-white border-bottom">
        <img src="images/rotaIcon.png" alt="Logo Rota COP30" className="mb-2" style={{ maxWidth: "180px" }} />
        <h1 className="fw-bold">ROTA COP30</h1>
      </header>
      <RotaCOP30 />
    </div>
  );
}

export default App;
